iterations.yara_rule:
rule Bypass_Sample
{
    meta:
        description = "Evasion bypass sequences detected in multiple execution traces"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 85 C0 0F 84 ?? ?? ?? ?? 8B 45 ?? }
        $pattern1 = { 5A 8B CE ?? 85 C0 FF 75 08 }
        $pattern2 = { 0F 84 74 07 8B EC 75 10 83 E8 ?? }
    condition:
        any of them
}

